class Solution {
    func sumCounts(_ nums: [Int]) -> Int {
        let mod = 1_000_000_007
        var answer: Int = 0
        var lastIndex = [Int: Int]()
        var prefixSum = [Int](repeating: 0, count: nums.count + 1)

        for i in stride(from: 0, to: nums.count, by: 1) {
            prefixSum[i + 1] = prefixSum[i] + 1
            if let last = lastIndex[nums[i]] {
                prefixSum[i + 1] -= prefixSum[last + 1]
            }
            lastIndex[nums[i]] = i
            answer = (answer + prefixSum[i + 1]) % mod
        }

        return answer
    }
}
